import React from 'react';
import { IconButton, majorScale } from 'evergreen-ui';
import { colors } from '../../../config/constants.js';

export const MobileMenuIcon = () => (
  <IconButton
    appearance="minimal"
    icon="menu"
    marginRight={-majorScale(1)}
    style={{ color: colors.primary }}
  />
);
